Описание:
От собственника! Без комиссии!
Продается земельный участок промназначения.
* с капитальными и некапитальными постройками
* земельный участок 0,5 га в собственности
* на первой линии улицы Профильная
* позволяет покупателю продолжить существующий бизнес или организовать свой

На территории находится:
- производственное помещение 178 кв.м с оборудованием под полимерную покраску;
- большой производственный цех 408 кв.м, отапливаемый печью на дровах;
- производственное помещение 234 кв.м с оборудованием для работ по металлу;
- помещение под торговые точки, кафе, магазин или другое 440 кв.м в черновой отделке;
- отдельное помещение для охраны;
- холодные склады 168 кв.м;
- 2 бетонных бункера по 432 кв.м высотой 6 метров из высокопрочного бетона (подходят как фундамент для дополнительных построек);

По периметру камеры видеонаблюдения;
Территория огорожена.

Так же в стоимость продажи входит оборудование: погрузчик, сварочные станки, гильотина, покрасочная камера, оборудование для кованных и ..., 43 фото
